import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import JSXElement from './App';
import * as serviceWorker from './serviceWorker';

const data = {
  buttonInfo: {
    buttonText: 'Button',
    customText1: 'You have clicked first button',
    customText2: 'You have clicked second button',
  }, 
};

ReactDOM.render(
  <JSXElement buttonInfo={data.buttonInfo}/>,
  document.getElementById('my-jsx-element')
);

serviceWorker.unregister();
